const PlasmicDescendants = {
  root: [
    "root",
    "loading",
    "img",
    "mobile",
    "mobileSubmit",
    "embedHtml",
    "codeTimer",
    "codeSubmit",
    "name",
    "code",
    "selectGender",
    "selectMarital",
    "cityInput",
    "codeSubmit2",
    "sideEffect",
    "modal",
    "city"
  ],
  loading: ["loading", "img"],
  img: ["img"],
  mobile: ["mobile"],
  mobileSubmit: ["mobileSubmit"],
  embedHtml: ["embedHtml"],
  codeTimer: ["codeTimer"],
  codeSubmit: ["codeSubmit"],
  name: ["name"],
  code: ["code"],
  selectGender: ["selectGender"],
  selectMarital: ["selectMarital"],
  cityInput: ["cityInput"],
  codeSubmit2: ["codeSubmit2"],
  sideEffect: ["sideEffect"],
  modal: ["modal", "city"],
  city: ["city"]
} as const;
type NodeNameType = keyof typeof PlasmicDescendants;
type DescendantsType<T extends NodeNameType> =
  (typeof PlasmicDescendants)[T][number];
type NodeDefaultElementType = {
  root: "div";
  loading: "div";
  img: typeof PlasmicImg__;
  mobile: typeof TextInput;
  mobileSubmit: typeof Button;
  embedHtml: typeof Embed;
  codeTimer: typeof CodeTimer;
  codeSubmit: typeof Button;
  name: typeof TextInput;
  code: typeof TextInput;
  selectGender: typeof Select;
  selectMarital: typeof Select;
  cityInput: typeof TextInput;
  codeSubmit2: typeof Button;
  sideEffect: typeof SideEffect;
  modal: typeof AntdModal;
  city: typeof City;
};

type ReservedPropsType = "variants" | "args" | "overrides";
type NodeOverridesType<T extends NodeNameType> = Pick<
  PlasmicLogin__OverridesType,
  DescendantsType<T>
>;
type NodeComponentProps<T extends NodeNameType> =
  // Explicitly specify variants, args, and overrides as objects
  {
    variants?: PlasmicLogin__VariantsArgs;
    args?: PlasmicLogin__ArgsType;
    overrides?: NodeOverridesType<T>;
  } &
    // Specify variants directly as props
    Omit<PlasmicLogin__VariantsArgs, ReservedPropsType> &
    // Specify args directly as props
    Omit<PlasmicLogin__ArgsType, ReservedPropsType> &
    // Specify overrides for each element directly as props
    Omit<
      NodeOverridesType<T>,
      ReservedPropsType | VariantPropType | ArgPropType
    > &
    // Specify props for the root element
    Omit<
      Partial<React.ComponentProps<NodeDefaultElementType[T]>>,
      ReservedPropsType | VariantPropType | ArgPropType | DescendantsType<T>
    >;

function makeNodeComponent<NodeName extends NodeNameType>(nodeName: NodeName) {
  type PropsType = NodeComponentProps<NodeName> & { key?: React.Key };
  const func = function <T extends PropsType>(
    props: T & StrictProps<T, PropsType>
  ) {
    const { variants, args, overrides } = React.useMemo(
      () =>
        deriveRenderOpts(props, {
          name: nodeName,
          descendantNames: PlasmicDescendants[nodeName],
          internalArgPropNames: PlasmicLogin__ArgProps,
          internalVariantPropNames: PlasmicLogin__VariantProps
        }),
      [props, nodeName]
    );
    return PlasmicLogin__RenderFunc({
      variants,
      args,
      overrides,
      forNode: nodeName
    });
  };
  if (nodeName === "root") {
    func.displayName = "PlasmicLogin";
  } else {
    func.displayName = `PlasmicLogin.${nodeName}`;
  }
  return func;
}

